export const FriendsWrapper = styled.div`
    grid-row: 1;
    grid-column: 1;
    border-radius: .5em;
    box-shadow: 0 0 .35em azure;
    width: 25em;
    h1 {
        font-size: 2em;
        text-align: center;
        margin-top: em;
    }
    height: fit-content;
`
